import React ,{useState} from 'react'
import axios from 'axios'

const url = "http://localhost:5000/"



class Active extends React.Component {

    constructor (props) {
        super(props);

        this.state={
            jk : null,
        }
    }

    componentDidMount(){
        axios.get(`${url}db`).then((response)=>{
            
            // console.table(response.data);
            const ipd = response.data;
            this.setState({jk : JSON.stringify(ipd) }); //JSON.stringify(ipd)
            console.log(typeof(response.data));
            console.log(this.state.jk);
            console.log(typeof(this.state.jk));
            const some = JSON.parse(this.state.jk);
            console.log(some);
      });
    }
    trial() {
        console.log(this.state.jk);    
    }

        render() {
            return (
                <>
                  <div>Log</div>
                  <div>
                      {/* <p>{JSON.stringify(this.state.jk)}</p> */}
                      {/* <p onClick={this.trial}>ho ho</p> */}
                      <p>{this.state.jk}</p>
                  </div>
                  <table className="table">
                      <thead className="table_head">
                          <tr>
                              <th>ID</th>
                              <th>SLDC</th>
                              <th>IP</th>
                              <th>Submited By</th>
                              <th>Active Now</th>
                              <th>Active From</th>
                              <th>Active Till</th>
                          </tr>
                      </thead>
                      <tbody className="table_body">
                          {
                              this.state.jk.map(({_id,sldc,ip,submitBy,activeNow,activeFrom,activeTill}) =>(
                                  <tr key={_id}>
                                      <td>{sldc}</td>
                                      <td>{ip}</td>
                                      <td>{submitBy}</td>
                                      <td>{activeNow}</td>
                                      <td>{activeFrom}</td>
                                      <td>{activeTill}</td>
                                    
                                  </tr>

                              ))
                          }
                      </tbody>
                  </table>
                </>
            )
        }
}


export default Active
